node.text:
There is no life without love. 
E probabilmente nemmeno senza una canzone da ricordare. Senza un luogo a cui tornare. Senza un ostacolo oltre il quale gettare il cuore per andare poi a riprenderlo. Senza il desideriodi qualcosa di divertente. E senza un profumo che ti faccia sentire la versione migliore di te stessa.

@miumiu ✨  #MiuMiuParfum #MiuMiuleaubleue #adv #thateveningfeeling #lalala

Ci salveremo in qualche modo. 
Aggrappandoci alla bellezza. Ai desideri. Al pezzo cielo sopra di noi. O certi giorni alla cioccolata. 
